package ar.com.ucema.ia.chess.model;public class ChessPlay {	private Integer rowFrom;	private String columnFrom;	private Integer rowTo;	private String columnTo;	public Integer getRowFrom() {		return rowFrom;	}	public void setRowFrom(Integer rowFrom) {		this.rowFrom = rowFrom;	}	public String getColumnFrom() {		return columnFrom;	}	public void setColumnFrom(String columnFrom) {		this.columnFrom = columnFrom;	}	public Integer getRowTo() {		return rowTo;	}	public void setRowTo(Integer rowTo) {		this.rowTo = rowTo;	}	public String getColumnTo() {		return columnTo;	}	public void setColumnTo(String columnTo) {		this.columnTo = columnTo;	}		}